import React from "react";
class Main extends React.Component{
    constructor(props){
        super(props)
        this.state={
            time:0,
            rules:{},
            pen:false,
            title: "Start",
            text: "null"
        }
    }
    render(){
        return(
            <div className="bg-dark">
                <h1 className="text-light">{this.state.title}</h1>
                <p className="text-light">{this.state.text}</p>
                <button className="btn btn-block btn-lg btn-light">Progress</button>
            </div>
        )
    }
        
}
export default Main
